import React, { useState } from "react";
import Draggable from "react-draggable";

const Cluster = ({ name }) => {
  return (
    <Draggable>
      <div className="cluster">
        {name}
      </div>
    </Draggable>
  );
};

const FleetScreen = () => {
  const [droppedItems, setDroppedItems] = useState([]);

  const handleDrop = (event) => {
    const itemName = event.dataTransfer.getData("text");
    setDroppedItems(prevItems => [...prevItems, itemName]);
  };

  const handleDragOver = (event) => {
    event.preventDefault();
  };

  return (
    <div className="drop-container" onDrop={handleDrop} onDragOver={handleDragOver}>
      <h2>Drag and Drop Example</h2>
      <div className="cluster-container">
        {[1, 2, 3, 4, 5].map((item) => (
          <Cluster key={item} name={`Cluster Name ${item}`} />
        ))}
      </div>
      <div className="dropped-items">
        <h3>Dropped Items</h3>
        <ul>
          {droppedItems.map((item, index) => (
            <li key={index}>{item}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default FleetScreen;
